г)  кредитный  договор  (соглашение)  не  предусматривает  взимания  с  заемщика  комиссий  и
сборов, иных платежей, за исключением:
платы  за  открытие  (резервирование)  кредитной  линии,  взимаемой  единоразово  или  частями  от
суммы лимита кредитной линии;
платы  за  пользование  лимитом  кредитной  линии,  взимаемой  за  не  использованный  заемщиком
остаток лимита кредитной линии;
платы за досрочное погашение кредита;
выплаты вознаграждения кредитному управляющему;
выплаты вознаграждения управляющему залогом;
уплаты  штрафных  санкций  в  случае  неисполнения  заемщиком  условий  кредитного  договора
(соглашения);
д) кредитный договор (соглашение) предусматривает получение заемщиком кредита по льготной
процентной  ставке,  рассчитанной  в  размере  разницы  между  процентной  ставкой  по  кредитному
договору без учета ее субсидирования и ставкой субсидирования;
